    <p style="padding-left: 124pt;text-indent: 0pt;text-align: center;">REPUBLIC OF THE PHILIPPINES PALOMPON INSTITUTE
        OF TECHNOLOGY PALOMPON, LEYTE</p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 34pt;text-indent: 0pt;text-align: center;">COLLEGE OF TECHNOLOGY AND ENGINEERING</p>
    <h1 style="padding-left: 34pt;text-indent: 0pt;text-align: center;">INFORMATION TECHNOLOGY DEPARTMENT</h1>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <p class="s1" style="padding-left: 56pt;text-indent: -3pt;line-height: 107%;text-align: center;">Developing a
        Web-Based Record Management System for the Extension Services Office at the Palompon Institute of Technology</p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 180pt;text-indent: 31pt;line-height: 165%;text-align: left;">Proponents <span
            class="p">Andoy, Renz Clayford V. Devocion, Jay Ann M.</span></h1>
    <p style="padding-left: 175pt;text-indent: 28pt;line-height: 165%;text-align: left;">Gomez, Kyle B. Losorata, Ma.
        Christine D.</p>
    <p style="padding-left: 196pt;text-indent: 0pt;line-height: 14pt;text-align: left;">Molero, Azlineb R.</p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 34pt;text-indent: 0pt;text-align: center;">RUBY MARY G. ENCENZO</h1>
    <p style="padding-top: 1pt;padding-left: 198pt;text-indent: 0pt;text-align: left;">Subject Instructor</p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 34pt;text-indent: 0pt;text-align: center;">APRIL 29, 2024</h1>
    <h1 style="padding-top: 3pt;padding-left: 34pt;text-indent: 0pt;text-align: center;">EXECUTIVE SUMMARY</h1>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 22pt;text-indent: 36pt;line-height: 150%;text-align: justify;">The Palompon Institute of
        Technology (PIT) Extension Services Office is tasked with managing a vast array of records related to extension
        activities. However, the current manual processes and paper-based documentation have led to inefficiencies in
        workflow management. To address these challenges, a comprehensive Web-Based Record Management System (WRMS) is
        proposed.</p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 22pt;text-indent: 36pt;line-height: 150%;text-align: justify;">The primary objective of this
        project is to develop a web-based RMS specifically for the Extension Services Office at PIT. This system aims to
        centralize and organize extension-related records, streamline processes, and enhance overall efficiency. Through
        careful planning, design, development, testing, and deployment phases, the WRMS will offer user-friendly
        interfaces, secure access controls, and centralized data storage capabilities.</p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 22pt;text-indent: 36pt;line-height: 150%;text-align: justify;">Key features of the proposed
        RMS include the ability to generate reports from off-campus extension services records, cater to the operational
        needs of the office, and ensure compliance with data protection regulations through strong security measures.
    </p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 22pt;text-indent: 36pt;line-height: 150%;text-align: justify;">While the scope of the
        project is comprehensive, potential limitations such as external factors (changes in technology or regulations)
        and resource constraints (budgetary and time limitations) are acknowledged. Efforts will be made to proactively
        address these limitations throughout the project lifecycle to ensure successful completion.</p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 22pt;text-indent: 36pt;line-height: 149%;text-align: justify;">Overall, the proposed WRMS
        seeks to revolutionize the management of extension-related records at PIT, benefiting office staff responsible
        for data</p>
    <p style="padding-top: 3pt;padding-left: 22pt;text-indent: 0pt;line-height: 149%;text-align: justify;">handling and
        ultimately improving the efficiency and effectiveness of extension services.</p>
    <p style="padding-top: 8pt;padding-left: 22pt;text-indent: 36pt;line-height: 150%;text-align: justify;">If the
        developed software needs to interface with external systems, such as existing databases or collaboration
        platforms, data interchange formats would need to be established to ensure seamless communication. This could
        involve using standardized formats like XML or JSON for exchanging data between systems, as well as establishing
        secure APIs or data connectors to facilitate integration. Compatibility with different hardware configurations
        and software versions of external systems must also be considered to ensure smooth interoperability.</p>
    <h1 style="padding-top: 8pt;padding-left: 34pt;text-indent: 0pt;text-align: center;">OBJECTIVES</h1>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;"><br /></p>
    <ol id="l1">
        <li data-list-text="1.">
            <p style="padding-left: 43pt;text-indent: -18pt;line-height: 151%;text-align: justify;">Centralizing and
                organizing records related to extension activities particularly off-campus extension records;</p>
        </li>
        <li data-list-text="2.">
            <p style="padding-left: 43pt;text-indent: -18pt;line-height: 151%;text-align: justify;">Generating a report
                from the different off-campus extension services records of every college in PIT;</p>
        </li>
        <li data-list-text="3.">
            <p style="padding-left: 43pt;text-indent: -18pt;line-height: 150%;text-align: justify;">Providing
                user-friendly interfaces for efficient data entry, retrieval, and reporting, and responding to the
                requirements of extension service operation; and</p>
        </li>
        <li data-list-text="4.">
            <p style="padding-left: 43pt;text-indent: -18pt;line-height: 149%;text-align: justify;">Implement strong
                security measures in place to secure sensitive information and ensure compliance with regulations
                governing data protection.</p>
            <p style="text-indent: 0pt;text-align: left;"><br /></p>
            <h1 style="padding-left: 133pt;text-indent: 0pt;text-align: left;">SYSTEM REQUIREMENT SPECIFICATIONS</h1>
            <p style="text-indent: 0pt;text-align: left;"><br /></p>
            <h1 style="padding-left: 22pt;text-indent: 0pt;text-align: justify;">Functional Requirements</h1>
            <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;"><br /></p>
            <ol id="l2">
                <li data-list-text="1.">
                    <p class="s2" style="padding-left: 58pt;text-indent: -18pt;line-height: 149%;text-align: left;">
                        Centralized Data Storage. <span class="p">The system should allow for storing off-campus
                            extension-related data in a central location.</span></p>
                </li>
                <li data-list-text="2.">
                    <p class="s2" style="padding-left: 58pt;text-indent: -18pt;line-height: 149%;text-align: left;">
                        User-Friendly Interfaces<span class="p">. Intuitive interfaces for data entry, retrieval,
                            and reporting to ensure ease of use.</span></p>
                </li>
                <li data-list-text="3.">
                    <p class="s2"
                        style="padding-top: 3pt;padding-left: 58pt;text-indent: -18pt;line-height: 150%;text-align: justify;">
                        Record Management Functionalities. <span class="p">Capability for uploading, downloading,
                            and monitoring extension activity records. Ability to search and filter records based on
                            various criteria. Viewing information about extension activities and achievements.</span>
                    </p>
                </li>
                <li data-list-text="4.">
                    <p class="s2"
                        style="padding-left: 58pt;text-indent: -18pt;line-height: 150%;text-align: justify;">Reporting
                        Functionalities. <span class="p">Ability to generate reports on off-campus extension
                            activities, achievements, participant demographics, and program outcomes.</span></p>
                </li>
                <li data-list-text="5.">
                    <p class="s2"
                        style="padding-left: 58pt;text-indent: -18pt;line-height: 150%;text-align: justify;">Security
                        Functionalities. <span class="p">Implementation of user authentication, access control
                            mechanisms, and data encryption to ensure data security and prevent unauthorized
                            access.</span></p>
                    <p style="text-indent: 0pt;text-align: left;"><br /></p>
                    <h1 style="padding-left: 40pt;text-indent: -18pt;line-height: 209%;text-align: justify;">
                        Non-Functional Requirements Operational Requirements</h1>
                    <ol id="l3">
                        <li data-list-text="1.">
                            <p class="s2"
                                style="padding-left: 76pt;text-indent: -18pt;line-height: 150%;text-align: justify;">
                                Accessibility. <span class="p">The system should be available from any device with
                                    a web browser and, depending on the solution may require internet access.</span></p>
                        </li>
                        <li data-list-text="2.">
                            <p class="s2"
                                style="padding-left: 76pt;text-indent: -18pt;line-height: 149%;text-align: justify;">
                                Integration. <span class="p">Integration with the Extension Service Office&#39;s
                                    existing workflows.</span></p>
                        </li>
                    </ol>
                </li>
            </ol>
        </li>
    </ol>
    <h1 style="padding-top: 8pt;padding-left: 40pt;text-indent: 0pt;text-align: justify;">Performance Requirements</h1>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;"><br /></p>
    <ol id="l4">
        <li data-list-text="1.">
            <p class="s2" style="padding-left: 76pt;text-indent: -18pt;line-height: 151%;text-align: left;">
                Responsiveness. <span class="p">The system should respond efficiently to user actions, resulting
                    in prompt page loading and data retrieval speeds.</span></p>
        </li>
        <li data-list-text="2.">
            <p class="s2" style="padding-left: 76pt;text-indent: -18pt;line-height: 151%;text-align: left;">
                Scalability. <span class="p">Capability to manage a specific number of concurrent users and data
                    volume, based on the projected usage.</span></p>
        </li>
    </ol>
    <h1 style="padding-top: 7pt;padding-left: 40pt;text-indent: 0pt;text-align: left;">Security Requirements</h1>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;"><br /></p>
    <ol id="l5">
        <li data-list-text="1.">
            <p class="s2" style="padding-left: 76pt;text-indent: -18pt;line-height: 149%;text-align: left;">Access
                Controls<span class="p">. Secure access controls should be set to prevent unauthorized access to
                    sensitive data.</span></p>
        </li>
        <li data-list-text="2.">
            <p class="s2" style="padding-left: 76pt;text-indent: -18pt;line-height: 149%;text-align: left;">Data
                Security. <span class="p">Procedures should be in place to protect data security and prevent
                    breaches, as specified in the project scope.</span></p>
        </li>
    </ol>
    <h1 style="padding-top: 3pt;padding-left: 34pt;text-indent: 0pt;text-align: center;">ACTORS</h1>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 22pt;text-indent: 0pt;line-height: 150%;text-align: left;">Extension Office Director <span
            class="p"> is the head of the extension office. She is the super admin of the system, who is
            authorized to assign roles in the system. She can also see the system&#39;s overall activities and generate
            a report.</span></h1>
    <h1 style="padding-top: 8pt;padding-left: 22pt;text-indent: 0pt;line-height: 149%;text-align: left;">Extension
        Office Clerks <span class="p"> These are the staff who have permission to upload the files and input the
            approved extension activities in the system.</span></h1>
    <h1 style="padding-top: 8pt;padding-left: 22pt;text-indent: 0pt;line-height: 150%;text-align: left;">Extension Unit
        Heads <span class="p"> These are the extension unit heads of every college at PIT. Their only role is to
            download files and monitor the status of the extension activities of their assigned college.</span></h1>
    <h1 style="padding-top: 3pt;padding-left: 34pt;text-indent: 0pt;text-align: center;">USE CASE DIAGRAM</h1>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 24pt;text-indent: 0pt;text-align: left;"><span>
            <table border="0" cellspacing="0" cellpadding="0">
