    <h1 style="padding-top: 3pt;padding-left: 34pt;text-indent: 0pt;text-align: center;">USE CASE SCENARIO</h1>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 22pt;text-indent: 0pt;line-height: 150%;text-align: left;">U1. Input list of approved
        extension activities: <span class="p">In this case, the clerk can input the details of the approved
            extension activities list.</span></h1>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 22pt;text-indent: 0pt;line-height: 150%;text-align: left;">U2. Upload required documents
        for monitoring: <span class="p">The clerk can be able to upload necessary documents, oversee the activity,
            and stay informed about the status updates of the activity.</span></h1>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 22pt;text-indent: 0pt;text-align: left;">U3. View Activity Status: <span
            class="p">In this case, there are 2 scenarios.</span></h1>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;"><br /></p>
    <p class="s3" style="padding-left: 22pt;text-indent: 0pt;text-align: left;">Scenario 1: Extension Director and
        Clerk Interface</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 22pt;text-indent: 36pt;line-height: 151%;text-align: left;">In this scenario, both the
        Extension Director and Clerk can view the overall matrix and status of activities of all colleges.</p>
    <p class="s3" style="padding-top: 7pt;padding-left: 22pt;text-indent: 0pt;text-align: left;">Scenario 2: Unit
        heads Interface</p>
    <p style="padding-top: 1pt;text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 22pt;text-indent: 36pt;line-height: 150%;text-align: left;">In this scenario, the unit
        heads can only check the matrix and status of activities assigned to their respective colleges, he/she cannot
        allow to view the status and matrix of other colleges.</p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 22pt;text-indent: 0pt;line-height: 149%;text-align: left;">U4. Generate Report: <span
            class="p">The extension director can generate reports on various extension services activities
            recorded in the system.</span></h1>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 22pt;text-indent: 0pt;line-height: 151%;text-align: left;">U5. Download Files<span
            class="p">: In this case, the unit heads of each college can access and download the files specific to
            their respective colleges only.</span></h1>
    <h1 style="padding-top: 3pt;padding-left: 22pt;text-indent: 0pt;line-height: 150%;text-align: left;">U6. Managing
        User Accounts: <span class="p">The extension Service Director oversees user account management, including
            updating user roles, to ensure access to the system is appropriately managed and maintained.</span></h1>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
    <h1 style="padding-left: 198pt;text-indent: 0pt;text-align: left;">ACTIVITY DIAGRAM</h1>
    <p style="padding-top: 6pt;text-indent: 0pt;text-align: left;"><br /></p>
    <p style="padding-left: 36pt;text-indent: 0pt;text-align: left;"><span>
            <table border="0" cellspacing="0" cellpadding="0">
                <tr>
                    <td><img width="541" height="319"
                            src="data:image/jpg;base64," />
                    </td>
                </tr>
                <tr>
                    <td><img width="541" height="318"
                            src="data:image/jpg;base64," />
                    </td>
                </tr>
            </table>
        </span></p>
    <p style="padding-top: 3pt;padding-left: 29pt;text-indent: 28pt;line-height: 150%;text-align: justify;">The
        activity diagram outlines the workflow for managing off-campus records within the Extension Services Office at
        PIT. Users log in using their credentials. The Extension Office clerk inputs details of approved extension
        activities based on the board-approved work and financial plan proposal. The clerk also uploads necessary
        documents for monitoring activities and checks status updates. Activity status is viewable by the clerk,
        Extension Service Director, and extension unit heads of each college. Unit heads can monitor activities assigned
        to their colleges and download college-specific files. The Extension Service Director can generate reports on
        various extension activities recorded in the system. Additionally, the Extension Service Director oversees user
        account management, including updating user roles. This ensures that access to the system is appropriately
        managed and maintained.</p>
    <p style="text-indent: 0pt;text-align: left;"><br /></p>
